  [],\n\t\"revision_timestamp\": \"2015-05-07T03:45:45.446131\",\n\t\"name\": \"optimized-magnetic-nozzles-for-mpd-thrusters-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Magnetoplasmadynamic (MPD) thrusters can
  provide the high-specific impulse, high-power propulsion required to enable ambitious
  human and robotic exploration missions to the Moon, Mars, and outer planets. Whereas
  the thrust and power densities of Hall and Ion thrusters are limited by space charge
  effects, MPD thrusters can process very high power levels while providing high specific
  impulse thrust.  MPD thrusters, however, have traditionally been plagued by poor
  thrust efficiencies.  These inefficiencies are due primarily to power lost into
  the anode caused by the Hall effect.  TUI proposes to apply innovative techniques
  for using applied magnetic nozzles to eliminate these anode power losses and dramatically
  improve the performance of MPD thrusters.  In the proposed Phase I effort, TUI will
  develop magnetic nozzle designs optimized to maximize the thrust efficiency of MPD
  thruster systems, minimizing anode fall power losses and maximizing the efficiency
  of plasma detachment from the magnetic nozzle.  In the Phase II effort, we will
  build and test prototypes of these magnetic nozzles, and obtain definitive measurements
  of their enhancement of MPD thruster efficiencies.\",\n\t\"license_title\": \"U.S.
